    <style>
        body {
            position: absolute;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            overflow: hidden;
            margin: 0;
            padding: 0;
        }

        div#splash-screen {
            position: absolute;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            z-index: 999999;
            background: #840;
            display: flex;
            justify-content: center;
            align-items: center;
            font-size: 5vmin;
            font-family: sans-serif;
        }

        div#splash-screen>div.title {
            position: absolute;
            left: 0;
            top: 0;
            width: 100%;
            text-align: center;
            color: #ffcb97;
            padding: 1em;
        }
